class StdDev:
    K: float 
    Ex: float 
    Ex2: float 
    n: int 

    def __init__(self):
        self.K = self.Ex = self.Ex2 = 0.0
        self.n = 0

    def add_variable(self, x: float) -> None:
        if self.n == 0:
            self.K = x
        self.n += 1
        self.Ex += x - self.K
        self.Ex2 += (x - self.K) ** 2

    def remove_variable(self, x: float) -> None:
        self.n -= 1
        self.Ex -= x - self.K
        self.Ex2 -= (x - self.K) ** 2

    @property
    def mean(self) -> float:
        return self.K + self.Ex / self.n

    @property
    def variance(self) -> float:
        return (self.Ex2 - self.Ex ** 2 / self.n) / (self.n - 1)

