        ll n,m,k;
        cin>>n>>m>>k;
        map<ll,ll> m1;
        map<pair<int, int>,ll> m2;
        ll u=0,o=0;

        for(ll i=0;i<k;i++){
            ll x,y;cin>>x>>y;
            m2[{x,y}]=i;
            m1[y]=max(m1[y],x);
            u=max(u,x);
